Funciones/eventos.sol.content:
pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

contract Eventos{

    event eventito (string _nombrePersona);
    event eventito2 (string _nombrePersona);

    
    function EmitirEvento(string memory _nombrePersona) public {
        emit eventito(_nombrePersona);
    }

    function EmitirEvento2(string memory _nombrePersona, uint e) public {
        emit eventito(_nombrePersona);
    }



}

